import { createSlice, createAsyncThunk } from "@reduxjs/toolkit";

const SocketSlice = createSlice({
  name: "socket",
  initialState: [],
  reducers: {
    getSocketStatus: (state) => {
      return state;
    },
  },
});
export default SocketSlice.reducer;
